                "text": "Basic tabset example\n\n```\n<nb-tabset>\n <nb-tab tabTitle=\"Simple Tab #1\">\n   Tab content 1\n </nb-tab>\n <nb-tab tabTitle=\"Simple Tab #2\">\n   Tab content 2\n </nb-tab>\n</nb-tabset>\n"
